const FilterUpcoming = (originalRidesState,dispatch,rideAdd) => {

    const timeNow = new Date();
    let timeNow_ = timeNow.getTime();
    let originalUpcoming = originalRidesState.filter( el => new Date(el.date).getTime() > timeNow_ )
    return dispatch(  rideAdd( {rides_data:originalUpcoming, upcomingCount:originalUpcoming.length } ) );

}
export default FilterUpcoming;
